// Dashboard.tsx
import React from "react";
import TopStudiosSection from "./Dashboard/studios/getTopStudiosSection";
import ProducerIntervalsSection from "./Dashboard/producer/ProducerIntervalsSection";
import WinningMoviesSection from "./Dashboard/winner/WinningMoviesSection";
import YearsWithMultipleWinnersSection from "./Dashboard/winner/YearsWithMultipleWinnersSection";

const Dashboard: React.FC = () => {
  return (
    <div>
      <WinningMoviesSection />

      <YearsWithMultipleWinnersSection />

      <TopStudiosSection />

      <ProducerIntervalsSection />
    </div>
  );
};

export default Dashboard;
